import logo from './logo.svg';
import './App.css';
import Dashboard from './views/'

function App() {
  return (
    <div className="App">

      <fieldset>
        <h1> Community Events </h1> 

        <Routes>
          <Route path="/" element={<Dashboard />}></Route>
        </Routes>
      </fieldset>

    </div>
  );
}

export default App;
